
n, m = map(int, input().split())
arr = [list(map(int, input().split())) for _ in range(n)]
commands = [tuple(map(int, input().split())) for _ in range(m)]
# commands[0] ; 방향, commands[1] ; 이동하는 칸 의 수


# 8가지 방향
dx = [0, -1, -1, -1, 0, 1, 1, 1]
dy = [-1, -1, 0, 1, 1, 1, 0, -1]
# 구름 위치 정보
clouds = [(n-1, 0), (n-1, 1), (n-2, 0), (n-2, 1)]

for d, s in commands:
    moved_clouds = []
    # 구름 이동(비바라기 시전)
    for x, y in clouds:
        nx, ny = (x + s * dx[d-1]) % n, (y + s * dy[d-1]) % n # 이동 후
        moved_clouds.append((nx, ny)) # 구름 위치 교체

    # 비 내리기
    for i in range(len(moved_clouds)):
        x, y = moved_clouds[i]
        arr[x][y] += 1

    # 물복사 버그 시전
    for x, y in moved_clouds:
        count = 0
        # 대각선 방향 확인
        for j in range(1, 8, 2):
            nx, ny = x + dx[j], y + dy[j]
            if 0 <= nx < n and 0 <= ny < n and arr[nx][ny] > 0:
                count += 1
        # 물복사~
        arr[x][y] += count

    # 구름 만들기
    new_clouds = []
    for x in range(n):
        for y in range(n):
            # 기존 구름이 있었던 곳이 아니면서, 물의 양이 2 이상인 경우
            if (x, y) not in moved_clouds and arr[x][y] >= 2:
                new_clouds.append((x, y)) # 새로운 구름에 추가
                arr[x][y] -= 2 # 물의양 줄이기

    clouds = new_clouds # 구름 교체

sum_water = 0
for i in range(n):
    sum_water += sum(arr[i])

print(sum_water)
